import React from 'react';
import './widget_style.css';

function Widget(props) {
    console.log('widget '+ props.key);
    return (
        <div className='widget-wrapper'>
            <div className="close-widget" onClick={() => {props.deleteCities(props.current.value)}}>
                <span></span>
                <span></span>
            </div>
            <p>{props.name}</p>
            <p>27+</p>
        </div>
    );
}

export default Widget;
